import React from 'react';
import './Team.css';

const TeamSection = () => {
  return (
    <section className="team-section">
      <div className="team-container">
        <h2>Наша команда</h2>
        <p>
          Тут йде текстовий опис команди. Ви можете вказати інформацію про
          професіоналізм, основні цінності або особливості вашої команди.
          Це може бути мотиваційний текст чи перелік досягнень.
        </p>
      </div>
    </section>
  );
};

export default TeamSection;
